import React, { useState } from 'react';
import { faTimes } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Button, IncrementDecrement } from 'components';
import { Background, ModalContainer, Label, SelectContainer, ButtonContainer, Icon } from './styled';

const Component = ({ valueSelect, setValueSelect, event, showModal }) => {

    return (
        <Background>
            <ModalContainer>
                <Icon onClick={showModal}>
                    <FontAwesomeIcon icon={faTimes} />
                </Icon>

                <Label>
                    ¿Cuántos dias quieres rentar el producto?
                </Label>
                <SelectContainer>
                    <IncrementDecrement valueSelect={valueSelect} setValueSelect={setValueSelect} limit={valueSelect + 1} />
                </SelectContainer>
                <p>Recuerda que el tiempo de renta comienza una vez recibas el producto</p>
                <ButtonContainer>
                    <Button children={"Realizar renta"} onClick={event} />
                </ButtonContainer>

            </ModalContainer>
        </Background>
    );
}

export default Component;
export { Component as Modal }
